import React from "react";
import "./Table.css";
function Table() {
  return (
    <div className="table-container">
      <div className="table-header">
        <h1>table</h1>
      </div>

      <div class="table-wr container">
        <div class="row table-wr">
          <div class="col-sm gr-form">
              <div className="gr-title">
              Back-End Groups
              </div>
              <div className="gr-members">
                  <span>2</span>
              </div>
          </div>
          <div class="col-sm gr-title gr-form">Front-End Groups</div>
          <div class="col-sm gr-title gr-form">Data Engineer Groups</div>
        </div>
      </div>
    </div>
  );
}

export default Table;
